    //   background-size: cover;
    //   background-attachment: local;
    //   background-position: center;
    // }
  }
  &__shadow {
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background-color: rgba(0, 10, 0, 0.7);
    z-index: -1;
  }
}

